import React from 'react';
import './UtenteSolicitacao.css'

const PacientPageOne = () => {
    return (
      <div className="header-div">
        <diV></diV>
            <img
                src={require("./juntas-logo.png")}
                alt="logo"
                className='img'/>
        <div className="header-content">
          <p>Solicitação</p>
        </div>
      </div>   
    );
  }
  
export default PacientPageOne;
